import React from 'react';
import { _ViewCans } from '../../stl-cmp';
import search from '../../img/search.svg';

const ViewCans = () => {
	return (
		<_ViewCans>
			<form>
				<label>
					<p>Busca un Can</p>
					<div>
						<input type="text" />
						<button>
							<object data={search} type="image/svg+xml" />
						</button>
					</div>
				</label>
			</form>
		</_ViewCans>
	);
};

export default ViewCans;
